import React from 'react';
import ReactDom from 'react-dom/client';
import './style.css';

const root = ReactDom.createRoot(document.getElementById("root"));
function Navbar() {
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>Prodct |</li>
        <li>About |</li>
        <li>Contact</li>
      </ul>
    </nav>
  )
};
function Search() {
  return(
    <div className='searchbar'>
      <input type='text' placeholder='required'></input>
    </div>
  )
}



root.render(
  <div>

    <Navbar />
  </div>
)
